import React from "react";
import {Header, Divider, Segment, Form} from "semantic-ui-react"

export default function Contact() {
    const square = { width: 175, height: 175 }

    return (
        <div>
            <Header as="h2" textAlign="center">Επικοινωνήστε με το ypakp.gr</Header>
            {/* <Segment raised floated="left"> */}
                <Form>
                    <Form.Group widths='equal'>
                        <Form.Input fluid label='First name' placeholder='First name' />
                        <Form.Input fluid label='Last name' placeholder='Last name' />
                    </Form.Group>
                    <Form.TextArea label='About' placeholder='Tell us more about you...' />
                    <Form.Checkbox label='I agree to the Terms and Conditions' />
                    <Form.Button>Submit</Form.Button>
                </Form>
            {/* </Segment> */}
                <Segment floated="right" circular style={square}>
                    <Header as='h2'>
                        Κράτηση
                        <Header.Subheader>$10.99</Header.Subheader>
                    </Header>
                </Segment>

        </div>

    );
}
